import React from 'react';
import DensityMediumIcon from '@mui/icons-material/DensityMedium';
import { Link } from 'react-router-dom';
const HeaderPage = () =>{
    return ( 
        <div>
        <div className="flex items-center w-full h-[50px] bg-white fixed inset-x-0 top-0">
        <Link to="#" className="ml-4 mt-1 flex justify-center items-center w-10 h-10 hover:bg-gray-300 rounded-full">
            <DensityMediumIcon />
        </Link>
        <input
            type="text"
            placeholder="Search"
            className="flex-1 w-50 px-4 py-2 border border-gray-300 rounded-md shadow-sm placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
        />
        </div>

        <div className="h-screen bg-gray-200"> 
           
        </div>

        </div> 
    );
}
export default HeaderPage;
